      <div className="App">

          <div style={{ color : "#404040" }} >
              <h1>About me</h1>

              <Row>
                  <Col md={6}>
                  <img src={profilepic} alt="me" style={{  height : '100%', width : 'auto', borderRadius : '50%'}} />
                  </Col>
                  <Col md={6}>
                      <h2>Yohan Arejouane</h2>
                      <h2>Full Stack Developer</h2>
                      <img src={location} /> <label>Israel</label>
                  </Col>
              </Row>
          </div>





      </div>
    );
  }

  export default AboutmeComp;
